css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("startpage.com") {
  
input#query {color: #000000!important;background:#ffffff!important}
input#query_top {background:#ffffff!important}  

ul#video-lemmon-slider-ul {background: #f7f7f7 !important;}
ul#pics-lemmon-slider-ul {background: #f7f7f7 !important;}
div#video-full-display.video {background: #222222 !important;}
div#pics-full-display.pics {background: #222222 !important;}
label#full-video-name.font_bold {color: #d6d6ca !important;}
label#full-image-name.image-info {color: #d6d6ca !important;}
tbody {color: #7d7d7d !important;}
div#wrapper.media_wrapper {background: #ffffff!important;}
 
div.selected-img-info {color: #7d7d7d !important;}
a#full-image-view {color: #7d7d7d !important;}
a#full-image-page {color: #7d7d7d !important;}
a#full-image-page-anonymous {color: #7d7d7d !important;}
  
body.air-theme .navbar-default.navbar-static-side.unselectable {top:120px!important;}

/*ixnay*/
a.addsettings.startmail_link, div.extended-scrollbtn-text, span.pe_start, p#caption, div#sponsored_csa1, .sponsored, .head2, .midline_right, #settings, .enhanced_by_td, .cloud {display:none !important}
  
/**Top Bar**/
.pics_results, .video_results {margin-top: 22px !important;}
a.tools.links_n.tools-large {margin-top: 4px !important;}
a.tools.links_n.tools-large.active {margin-top: -7px !important;}
#head_left {border-bottom: 1px solid #e1e8f5 !important;margin-top:1px!important;}
body.air-theme .navbar-default {top:0px!important;transition:none!important;position: absolute!important;}
div.three_line_menu {background: none!important;}
div.settings_cont {position: absolute!important;}
  
#head_left a {font-size:13px!important;
  font-family:arial,sans-serif!important;
  padding-left:4px !important;
  padding-right:4px !important;
}

#head_left .bookmark {display:none!important;}
#head_left a:hover {border:none!important;}
  
#head_left .links_n.active{
  font-size: 13px !important;
  font-family:arial,sans-serif!important;
  font-weight:700!important;
  color:#DD4B39!important;
  border-bottom: none!important;
  border-bottom:3px solid #DD4B39!important;
  margin-left:-3px!important;
  padding:9px !important;
  padding-left:4px !important;
  padding-right:4px !important;
}
  
div#head_left a {color:#777!important;}

/**Search Bar**/

.navbar .navbar-header {
  background-color: #f7f7f7 !important;
  background-image: none!important;
  height:70px!important;
  border-bottom: 1px solid #e1e8f5!important;
  border-top:1px solid #f7f7f7!important;
}
  
div#search {padding-top:14px!important;}
  
div#field_size.input_field {
  margin: 0px auto;
  border-radius: 2px!important;
  width:425px!important;
  max-width: 425px!important;
}
  
div#field_size.search-field {
  width:530px!important;
  max-width: 530px!important;  
  }
  
span.clear_search  {margin: 0px auto;}
  
div.search-field div.text-fields {width:410px!important;}
span.small-go-btn {min-width: 80px!important;background: #4D90FE!important}
div#search input#submit1, div#search input#submit1:focus {background: transparent none repeat scroll 0% 0% !important;}
div.search-field .text-fields {padding-right:-50px!important;}

a.navbar-brand img {display: none!important;}
  
a.navbar-brand {margin-left:30px!important;margin-top:5px!important;width:68px!important;height:36px!important;display:block;background-image:url("data:image/png;base64,");}


/*** Side Bar ***/  
ul#settings {display:none!important;}
ul.location_filter {border-bottom: none!important;}
ul#by_time li a.active {color:#DD4B39 !important;font-size: 16px !important;font-family:arial,sans-serif!important;font-weight:700!important;}
ul#by_time li a.no-date {color: #000 !important;font-size: 14px !important;font-family:arial,sans-serif!important;}
ul.location_filter li a.active {color:#DD4B39 !important;}
ul.location_filter li a {color:#000;}
.navbar-static-side{position:static !important;}
  
/*** Advanced Page ***/
  
div.advanced_search_page div#head_left {margin-top: 5px!important;}
div.advanced_search_page div div.navbar-header a.navbar-brand {width:110px!important;height:60px!important;}
.search-field .text-fields {padding-right: 0px!important;}
  
/*** Results ***/
  
div#results {padding-top:5px!important;}
#results .result h3 a span.result_url_heading {text-decoration:underline!important;font-family:arial,sans-serif!important;color:#3232CC!important;}
#results .result h3 a:visited span.result_url_heading {color:#551A8B!important;}
div#results .result a.url, #results .result span.url {color:#009900!important;font-size:14px!important;}
p.desc.clk {font-family:Arial!important;font-size:13px!important;color:#545454!important;}
a#proxy_link.proxy {font-family:Arial!important;font-size:14px!important;color:#777!important;}
a.proxy {font-family:Arial!important;font-size:14px!important;color:#777!important;}
  
/*** Search Suggestions ***/
  
div.ac_results {
  margin-top:-22px!important;
  margin-left:-1px!important;
}

div.ac_results:nth-child(3) {
  margin-top:-15px!important;
  margin-left:-12px!important;
}

/*** Settings ***/
 
div.slide-wrapper {
  z-index: 14!important;
  top:120px!important;
}

table.home-wrapper div.slide-wrapper {
  z-index: 14!important;
  top:80px!important;
}
  
.multimedia-div {margin: 19px 0px 0px !important;}

/*** Footer ***/
  
.classified .relatedlist_wrap p a {
  color:#1122CC!important;
}

/*** Main Page ***/
  
body div.cloud {background:none!important;}
div#enhanced {display:none!important;}
span.go-btn {display:none!important;}
  
form#search_form .midline .midline_left p {
  width:430px!important;
  border-radius:2px!important;
}
  
div#links {display: none!important;}
  
div.top_menu {
  width:100%!important;
  margin:0px!important;
  margin-top:6px!important;
  padding-bottom: 7px!important;
  text-align: left!important;
  border-bottom: 1px solid #F7F7F7 !important;
}
  
div.top_menu a {
  font-size:13px!important;
  color:#337fe2!important;
  font-family:arial,sans-serif!important;
  padding-left:4px !important;
  padding-right:4px !important;
}

div.top_menu a#web {margin-left: 10px!important;}
  
div.top_menu a.active {
  color:#DD4B39!important;
  font-family:arial,sans-serif!important;
  font-size:13px!important;
  font-weight:700!important;
  border-top:2px solid #DD4B39!important;
  padding:6px !important;
  padding-left:4px !important;
  padding-right:4px !important;
}
  
div#home_wrap div.settings_cont a#menu-icon-id {
  text-indent: 0px!important;
  background-position: 0px!important;
  position: relative!important;
  top:-20px!important;
  right:-25px!important;
  color:#337fe2!important;
  display: none!important;
}
  
div.top_menu.menu_en #xsearch{display:none;}
div.classified{display:none}
div#footer.footer {
  background-color: #F7F7F7 !important;
  border-top:1px solid #e1e8f5!important;
}

  
div#content a#main_link p#caption {display: none!important;}
div.newLook {display: none!important;}
  
div#content div#main_link img[src='/graphics/no_tm_startpage_retina_logo.png?v=2'] {height: 0 !important;width: 0 !important;margin-top: -58px !important;padding-left: 207px !important;padding-top: 113px !important;background: url("data:image/png;base64,") no-repeat !important;}
}
